SWIPE to see not 1, not 2, but 3!!! Looks done by Clio for the 90s decade! @justs0meartist

"I honestly love so many styles from this decade that I did a transformation of some of my favourites. Starting with the classic borderline crime against makeup: the blue frosted lid. It reminds me of pop icons and celebs like Cristina Agulera and J-Lo mixed with the super model brows and the fun weird updos. Then I wanted to do the classic grunge. Still thin brows with a brown Smokey eye and that classic 90s burgundy lip. I wanted to keep it slightly lighter because I was saving the heaviest for my favourite piece of 90s media. The final look is basically a cosplay of Nancy Downs from the Craft. This movie will always hold a special place in my heart as it was one of my mum’s favourite films and one of the last films I can remember watching with her, so this was a little “love letter” to my favourite 90s icon."

